tables.table_schema:
CREATE TABLE AlgorithmData (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(100),
    time_complexity VARCHAR(50),
    space_complexity VARCHAR(50)
);

CREATE TABLE algorithm_data (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    time_complexity VARCHAR(50),
    space_complexity VARCHAR(50)
);

CREATE TABLE algorithm_notes (
    note_id INT PRIMARY KEY,
    algorithm_id INT,
    note TEXT,
    CONSTRAINT fk_algorithm_id FOREIGN KEY (algorithm_id) REFERENCES algorithm_data(algorithm_id)
);

CREATE TABLE Algorithm_Data (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    time_complexity VARCHAR(50),
    space_complexity VARCHAR(50)
);

CREATE TABLE Algorithm_Steps (
    step_id INT PRIMARY KEY,
    algorithm_id INT,
    step_description TEXT,
    FOREIGN KEY (algorithm_id) REFERENCES Algorithm_Data(algorithm_id)
);

CREATE TABLE Algorithm_Inputs (
    input_id INT PRIMARY KEY,
    algorithm_id INT,
    input_data TEXT,
    FOREIGN KEY (algorithm_id) REFERENCES Algorithm_Data(algorithm_id)
);

CREATE TABLE Algorithm_Output (
    output_id INT PRIMARY KEY,
    algorithm_id INT,
    output_data TEXT,
    FOREIGN KEY (algorithm_id) REFERENCES Algorithm_Data(algorithm_id)
);

CREATE TABLE AlgorithmData (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(50),
    time_complexity VARCHAR(20),
    space_complexity VARCHAR(20)
);

CREATE TABLE ExecutionData (
    execution_id INT PRIMARY KEY,
    algorithm_id INT,
    execution_time FLOAT,
    executed_date TIMESTAMP
);

CREATE TABLE AlgorithmPrecedence (
    precedence_id INT PRIMARY KEY,
    ancestor_algorithm_id INT,
    descendant_algorithm_id INT
);

CREATE TABLE AlgorithmTags (
    tag_id INT PRIMARY KEY,
    algorithm_id INT,
    tag_name VARCHAR(20)
);

CREATE TABLE AlgorithmReviews (
    review_id INT PRIMARY KEY,
    algorithm_id INT,
    reviewer_name VARCHAR(50),
    review_text TEXT
);
